function addDropdownItems(optionsF) {
    // create DOM element to add to dropdown
    var familyDropdown = document.getElementById("familyDropdown");

	for(var h = 0; h < optionsF.length; h++) {
	
	    // add options to dropdown
		var opt4 = optionsF[h];
		var el4 = document.createElement("option");	
		el4.textContent = opt4;
		el4.value = opt4;
		familyDropdown.appendChild(el4);
	};
};

function populateDropdown(){
    // get all language families from data array and add them to the dropdown list

	const optionsF =  Object.keys(data2);
	//console.log(optionsF)

	optionsF.sort();
	
	addDropdownItems(optionsF)	
};

function pageLoader() { // set up the screen
    populateDropdown()
}



function redrawAll() {
   
   
   var selectFamily = document.getElementById("familyDropdown").value;
   let nodesIdExist = []
   var nodes = data2[selectFamily]["nodes"]
   var edges = data2[selectFamily]["edges"]

// from visjs.org
  // remove positoins
  for (var i = 0; i < nodes.length; i++) {

    delete nodes[i].x;
    delete nodes[i].y;
  }

  // create a network
  var container = document.getElementById("mynetwork");
  var data = {
    nodes: nodes,
    edges: edges, 
  };
  
  var moveToOptions = {
    // makes it zoom out after loading
    scale: 0.1,              // scale to animate to  (Number)
    animation: {             // animation object, can also be Boolean
      duration: 2000,                 // animation duration in milliseconds (Number)
      easingFunction: "easeInOutQuad" // Animation easing function, available are:
    }                                   // linear, easeInQuad, easeOutQuad, easeInOutQuad,
} 

  var options = {
    //autoResize: true,
    nodes: {
      shape: "dot",
      scaling: {
        min: 10,
        max: 30,
      },
      font: {
        size: 98,
        face: "Tahoma",
      },
    },
    edges: {
      color: { inherit: "from" },
      smooth: {
        type: "continuous",
      },
    },
    physics: {

      stabilization: false,
      barnesHut: {
        gravitationalConstant: -80000,
        springConstant: 0.001,
        springLength: 200,
      },
    },
    interaction: {
      tooltipDelay: 200,
      hideEdgesOnDrag: true,
    },
  };

  // 
  network = new vis.Network(container, data, options);
  network.moveTo(moveToOptions)
}

function selectPattern() {
    redrawAll();
}
